                  swal("Error!", "An Error Occured!", "error", {
                  button: false,
                  // timer: 1500
                });
                //console.log(error);
                $("#reg-button").removeAttr("disabled").html("Register");
              });
          });
      },
      onClose: () => null,
    };
    return isLoggedIn ? (
      <Redirect to={{ pathname: "/dashboard", state: { from: "/register" } }} />
